import '../textsFormate/formate.css';

export default function ProjetoPagina() {
    return (
        <div className="projeto-container">
            <div className="projeto-header">
                <h1 className="projeto-title">Título do Projeto</h1>
                <p className="projeto-subtitle">Subtítulo do Projeto</p>
            </div>
            <div className="projeto-content">
                <p className="projeto-text">Texto do Projeto</p>
            </div>
        </div>
    );
}
